import React from 'react';

const AppReducer = (state, action) => {

switch (action.type){
    
    case  'Add_Transaction':
        console.log('All Praise Goes to Allah who is Creater & Sustainer of The entire Universe!!')
        return state;
    case  'Delete_Transaction':
        return state;
    default: 
        return state;
}

};
export default AppReducer;
